import {
  MainContainer,
  ChatContainer,
  MessageList,
  Message,
  MessageInput,
} from "@chatscope/chat-ui-kit-react";

function MyButton() {
  return (
    <button>Find the best price and date!</button>
  )
}
function UI() {
  return (
    <div style={{ position:"relative", height: "500px" }}>
      <MainContainer>
        <ChatContainer>       
          <MessageList>
            <Message model={{
                    message: "Hello my friend",
                    sentTime: "just now",
                    sender: "Joe"
                    }} />
            </MessageList>
          <MessageInput placeholder="Type message here" />        
        </ChatContainer>
      </MainContainer>
    </div>
  )
}

